import { createApp } from "vue";
import App from "./App.vue";
import { i18n } from "./i18n";
import { createRouter } from "vue-router";
import routerList from "./router";

const router = createRouter({
  routes: routerList,
});

createApp(App).use(i18n, router).mount("#app");
